// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

interface IMembershipNFT {
    function ownerOf(uint256 tokenId) external view returns (address);
    function balanceOf(address owner) external view returns (uint256);
    function tokenOfOwnerByIndex(address owner, uint256 index) external view returns (uint256);
}

interface IRolesRegistry7432 {
    // Updated to match your registry's expected signature
    function hasRole(address tokenAddress, uint256 tokenId, bytes32 role) external view returns (bool);
}

contract DAO {
    struct Proposal {
        string description;
        uint256 yesVotes;
        uint256 noVotes;
        bool executed;
    }

    IMembershipNFT public membershipNFT;
    IRolesRegistry7432 public rolesRegistry;
    mapping(uint256 => Proposal) public proposals;
    uint256 public proposalCount;

    bytes32 public constant ROLE_VOTER = keccak256("VOTER");

    constructor(address _membershipNFT, address _rolesRegistry) {
        membershipNFT = IMembershipNFT(_membershipNFT);
        rolesRegistry = IRolesRegistry7432(_rolesRegistry);
    }

    // function hasVotingRights(address user, uint256 tokenId) public view returns (bool) {
    //     // Now passing the membership NFT contract address
    //     return rolesRegistry.hasRole(address(membershipNFT), tokenId, ROLE_VOTER);
    // }

    function hasVotingRights(address user) public view returns (bool) {
        uint256 balance = membershipNFT.balanceOf(user);
        for (uint256 i = 0; i < balance; i++) {
            uint256 tokenId = membershipNFT.tokenOfOwnerByIndex(user, i);
            // Updated to pass the token contract address
            if (rolesRegistry.hasRole(address(membershipNFT), tokenId, ROLE_VOTER)) {
                return true;
            }
        }
        return false;
    }

    function createProposal(string memory description) external {
        require(hasVotingRights(msg.sender), "Not authorized to create proposal");
        proposalCount++;
        proposals[proposalCount] = Proposal(description, 0, 0, false);
    }

    function vote(uint256 proposalId, bool support) external {
        require(hasVotingRights(msg.sender), "Not authorized to vote");
        Proposal storage proposal = proposals[proposalId];
        require(!proposal.executed, "Already executed");

        if (support) {
            proposal.yesVotes++;
        } else {
            proposal.noVotes++;
        }
    }

    function getProposal(uint256 proposalId) external view returns (Proposal memory) {
        return proposals[proposalId];
    }
}

contracts/TokenGatedDAO.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import "../Interfaces/IERC7432.sol";

contract TokenGatedDAO {
    struct Proposal {
        string description;
        uint256 deadline;
        uint256 forVotes;
        uint256 againstVotes;
        bool executed;
        mapping(bytes32 => bool) voted;
    }

    event Proposed(uint256 indexed id, address indexed proposer, uint256 tokenId, string description, uint256 deadline);
    event Voted(uint256 indexed id, address indexed voter, uint256 tokenId, bool support, uint256 weight);
    event Executed(uint256 indexed id, bool passed);

    IERC7432 public immutable rolesRegistry;
    address public immutable membershipCollection;

    bytes32 public constant ROLE_PROPOSER = keccak256("DAO_PROPOSER()");
    bytes32 public constant ROLE_VOTER = keccak256("DAO_VOTER()");
    bytes32 public constant ROLE_EXECUTOR = keccak256("DAO_EXECUTOR()");

    uint256 public votingPeriod = 3 days;
    uint256 public proposalCount;
    mapping(uint256 => Proposal) private _proposals;

    constructor(address _rolesRegistry, address _membershipCollection) {
        rolesRegistry = IERC7432(_rolesRegistry);
        membershipCollection = _membershipCollection;
    }

    function _roleActive(bytes32 roleId, address account, uint256 tokenId) internal view returns (bool) {
        if (rolesRegistry.recipientOf(membershipCollection, tokenId, roleId) != account) return false;
        uint64 exp = rolesRegistry.roleExpirationDate(membershipCollection, tokenId, roleId);
        return (exp == type(uint64).max || exp >= block.timestamp);
    }

    function propose(string calldata description, uint256 tokenId) external returns (uint256) {
        require(_roleActive(ROLE_PROPOSER, msg.sender, tokenId), "Not a proposer for this token");
        proposalCount++;
        Proposal storage p = _proposals[proposalCount];
        p.description = description;
        p.deadline = block.timestamp + votingPeriod;
        emit Proposed(proposalCount, msg.sender, tokenId, description, p.deadline);
        return proposalCount;
    }

function hasVotingRights(address account, uint256 tokenId) public view returns (bool) {
    return _roleActive(ROLE_VOTER, account, tokenId);
}

    function vote(uint256 id, uint256 tokenId, bool support) external {
        Proposal storage p = _proposals[id];
        require(p.deadline != 0, "No such proposal");
        require(block.timestamp < p.deadline, "Voting ended");
        require(_roleActive(ROLE_VOTER, msg.sender, tokenId), "Not a voter for this token");

        bytes32 voteKey = keccak256(abi.encodePacked(membershipCollection, tokenId, ROLE_VOTER));
        require(!p.voted[voteKey], "Already voted for this token");
        p.voted[voteKey] = true;

        if (support) p.forVotes++; else p.againstVotes++;
        emit Voted(id, msg.sender, tokenId, support, 1);
    }

    function execute(uint256 id, uint256 tokenId) external {
        Proposal storage p = _proposals[id];
        require(p.deadline != 0, "No such proposal");
        require(block.timestamp >= p.deadline, "Voting not ended");
        require(!p.executed, "Already executed");
        require(_roleActive(ROLE_EXECUTOR, msg.sender, tokenId), "Not an executor for this token");

        bool passed = p.forVotes > p.againstVotes;
        p.executed = true;
        emit Executed(id, passed);
    }

    function getProposal(uint256 id) external view returns (
        string memory description,
        uint256 deadline,
        uint256 forVotes,
        uint256 againstVotes,
        bool executed
    ) {
        Proposal storage p = _proposals[id];
        return (p.description, p.deadline, p.forVotes, p.againstVotes, p.executed);
    }
}

Interfaces/IERC7432.sol.content:
// SPDX-License-Identifier: CC0-1.0
pragma solidity ^0.8.20;

/// @title ERC-7432 Non-Fungible Token Roles
/// @dev See https://eips.ethereum.org/EIPS/eip-7432
interface IERC7432 {
    struct Role {
        bytes32 roleId;
        address tokenAddress;
        uint256 tokenId;
        address recipient;
        uint64  expirationDate;
        bool    revocable;
        bytes   data;
    }

    event TokenLocked(address indexed _owner, address indexed _tokenAddress, uint256 _tokenId);
    event RoleGranted(
        address indexed _tokenAddress,
        uint256 indexed _tokenId,
        bytes32 indexed _roleId,
        address _owner,
        address _recipient,
        uint64  _expirationDate,
        bool    _revocable,
        bytes   _data
    );
    event RoleRevoked(address indexed _tokenAddress, uint256 indexed _tokenId, bytes32 indexed _roleId);
    event TokenUnlocked(address indexed _owner, address indexed _tokenAddress, uint256 indexed _tokenId);
    event RoleApprovalForAll(address indexed _tokenAddress, address indexed _operator, bool indexed _isApproved);

    function grantRole(Role calldata _role) external;
    function revokeRole(address _tokenAddress, uint256 _tokenId, bytes32 _roleId) external;
    function unlockToken(address _tokenAddress, uint256 _tokenId) external;
    function setRoleApprovalForAll(address _tokenAddress, address _operator, bool _approved) external;

    function ownerOf(address _tokenAddress, uint256 _tokenId) external view returns (address owner_);
    function recipientOf(address _tokenAddress, uint256 _tokenId, bytes32 _roleId) external view returns (address recipient_);
    function roleData(address _tokenAddress, uint256 _tokenId, bytes32 _roleId) external view returns (bytes memory data_);
    function roleExpirationDate(address _tokenAddress, uint256 _tokenId, bytes32 _roleId) external view returns (uint64 expirationDate_);
    function isRoleRevocable(address _tokenAddress, uint256 _tokenId, bytes32 _roleId) external view returns (bool revocable_);
    function isRoleApprovedForAll(address _tokenAddress, address _owner, address _operator) external view returns (bool);
}

